import React from 'react';
import moment from 'moment';
import { Form } from 'react-bootstrap';

import './delivery.styles.scss';

const DeliveryPage = () => {

    const handleSubmit = event => {
        console.log(event)
    }

    const getAnimalsContent = animals => {
        let content = [];
        for (let i = 0; i < animals.length; i++) {
          const item = animals[i];
          content.push(<li key={item.id}>{item.animal}</li>);
        }
        return content;
      };

    return (

        <div className="container">
            <div className="row">
                <div className="col-3"></div>
                <div className="col-6 delivery-page">
                    <h2 className="delivery-slot">Delivery Slot</h2>
                    <Form className="date-picker" onSubmit={handleSubmit}>
                        <Form.Group controlId="exampleForm.SelectCustomSizeSm">
                            <Form.Label>Custom select Small</Form.Label>
                            <Form.Control as="select" size="sm" custom>
                                {this.getAnimalsContent()}
                            </Form.Control>
                        </Form.Group>
                    </Form>
                </div>
                <div className="col-3"></div>
            </div>
        </div>
    )
}

export default DeliveryPage;
